import React from "react";

type ButtonProps = {
  label?: string;
  icon?: React.ReactNode;
  leftIcon?: React.ReactNode;
  rightIcon?: React.ReactNode;
  isLoading?: boolean;
  disabled?: boolean;
  onClick?: () => void;
  style?: React.CSSProperties;
  spread?: boolean;
};

export const Button: React.FC<ButtonProps> = ({
  icon,
  label,
  leftIcon,
  rightIcon,
  isLoading = false,
  disabled = false,
  onClick,
  style,
  spread,
}) => {
  const buttonStyle: React.CSSProperties = {
    color: "white",
    fontWeight: "bold",
    justifyContent: "center",
    display: spread ? "d-flex" : "inline-block",
    ...style,
  };
  return (
    <div></div>
  );
};
